Reels','Welcome to JobReels',NULL,'Data Entry',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/Gurh1psa5Xrn8SvFrq19H2cUmVDaCON6MKYDdipL.mp4','thumbnail/VrUARPSN5ZVdrw3k2bVEoeTDGkFugF7aBVTat1Ox.png','published','',0,1,1,'2023-03-13 19:11:54','2023-04-28 18:04:46'),(199,199,'Sample','Sa',NULL,'[\"Quality Assurance\"]',NULL,NULL,NULL,NULL,'www.fb.com',NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/C4VNS7G1DgCvFtZeGcXobrKCUaLWvxJ3N9TuJN4J.mp4','thumbnail/g5flnkdKClU2onAv93LESjsAJNg5pQkFd5ndobmO.jpg','published','',1,0,1,'2023-04-30 19:17:07','2023-04-30 19:17:07'),(200,199,'Testtt','GGgahj','https://www.HH.com','[\"Human resource management\",\"Quality Assurance\"]',NULL,NULL,NULL,NULL,'www.fb.com',NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/BbDm6SfkHrDmnEsDim2luAdSqzbGlnCEy6Z3F18x.mov','thumbnail/02DsD27fOs5m5MhcZt67YmOtz2HMaSvjOQF76u73.jpg','published','',1,0,1,'2023-04-30 22:13:44','2023-04-30 22:13:44'),(201,199,'Hagat','BBbFG','https://www.ga.com','[\"Quality Assurance\",\"Excel\",\"Affiliate marketing\",\"Email marketing\"]',NULL,NULL,NULL,NULL,'www.fb.com',NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/52aTSWrfnqrzHRHsTjKPWcIOvgJ56jYvUqNj6DXp.mov','thumbnail/w67VBo0MOXqe7VrjrMgxRKkh6OvCRNVLGduzdsKD.jpg','published','',1,0,1,'2023-04-30 22:16:44','2023-04-30 22:16:44'),(202,199,'sample ios','sample ios 2. Like/share/comment to win with collab with influencers\n\n\noffer a prize to our target audience would be interested in, and then ask them to like, share, or comment on our post to enter\n\nGiveaway: Free coaching program to selected VA\n\n2. Creative Video Contents in Tiktok\n\nTo run a video contest, you can ask your followers to submit a short clip related to your contest theme, then select a winner based on creativity, originality, or whatever other criteria you choose.\n\n\n3. UGC Photo Contests in IG collab with other brand\n\nFor photo contests, you can ask people to:\n* Submit a photo of themselves using your product\n* Share a photo of themselves doing an activity that relates to your campaign\n* Show how they used your product in a creative way\n\n4. Tag-a-friend Contest \nAll you need to do is create a giveaway post that asks your followers to tag a friend (or three friends) for a chance to enter. You can even offer bonus entries for every friend that they tag.\n\n5. Join and share our live to win\nask audience to join our live and sharer will automatically be able to included in the possible winners \n\nWe can also ask them questions while in live with small winning items\n\n6. Follow to Win\n\nSkip the chit-chat and go right to the point–ask users to follow your social media page for a chance to win.\n\n7. Reoccuring Draw Contests\nThis could be a weekly or monthly draw where you give away a prize at consistent intervals. To sweeten the deal, you can offer different prizes each time or even bump up the value of the prize as time goes on.\n\nThis is to avoid being unfollowed\n\n8. Signup contests\n\nYou can use sign-up contests to gather lead info on your customers. To do this, simply ask contest entrants to sign up in exchange for a deal or offer.\n\n9. Direct entrants to landing page\n\nAnother way to get contest entries is to direct people from your social media channels to a contest landing page. This can be done through organic or boosted posts, Or, or even just a regular social media post.\n\n\nExample:\n\nWe threw this family back to their #tbt. Post w/ #ThrowMeBack @Expedia for a chance to relive yours. expd.ud/E8Z1kV\n\n\n\n\n10. Collaborative Contest to increase brand awareness\n\nFor example, you could team up with an influencer to give away one of your products to their followers. Or, you could partner with a relevant brand to double the prize offers of your contest.\n\n11. Hashtag Challenges \nrely on user-generated content. All you need is a catchy hashtag and some prize incentives.','https://drive.google.com/file/d/1tG-ArkpTR7KNb4aFUka1hIdgc0nPwz3f/view?usp=drivesdk','[\"Human resource management\",\"Quality Assurance\",\"Email Management\"]',NULL,NULL,NULL,NULL,'www.fb.com',NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/RqhqIBBH2Yi304mGZEh6lgypG8wVYOpf5TXNlk4F.mov','thumbnail/phyB9hHzDE7xYz3ch0Uf1JwF7TBvfq5MGhQlHNwg.jpg','published','',1,0,1,'2023-05-01 11:29:06','2023-05-01 11:29:06'),(203,199,'s','Contest Ideas\n\n2. Like/share/comment to win with collab with influencers\n\n\noffer a prize to our target audience would be interested in, and then ask them to like, share, or comment on our post to enter\n\nGiveaway: Free coaching program to selected VA\n\n2. Creative Video Contents in Tiktok\n\nTo run a video contest, you can ask your followers to submit a short clip related to your contest theme, then select a winner based on creativity, originality, or whatever other criteria you choose.\n\n\n3. UGC Photo Contests in IG collab with other brand\n\nFor photo contests, you can ask people to:\n* Submit a photo of themselves using your product\n* Share a photo of themselves doing an activity that relates to your campaign\n* Show how they used your product in a creative way\n\n4. Tag-a-friend Contest \nAll you need to do is create a giveaway post that asks your followers to tag a friend (or three friends) for a chance to enter. You can even offer bonus entries for every friend that they tag.\n\n5. Join and share our live to win\nask audience to join our live and sharer will automatically be able to included in the possible winners \n\nWe can also ask them questions while in live with small winning items\n\n6. Follow to Win\n\nSkip the chit-chat and go right to the point–ask users to follow your social media page for a chance to win.\n\n7. Reoccuring Draw Contests\nThis could be a weekly or monthly draw where you give away a prize at consistent intervals. To sweeten the deal, you can offer different prizes each time or