ed and likely killed a man after repeatedly biting the victim and dragging him underwater. Eyewitnesses reported that the shark returned to the victim three times — an atypical behavior in what was already a rare attack. ',NULL,'[\"Human resource management\",\"Email Management\",\"Admin assistant\",\"Excel\",\"Web Content writing\",\"Affiliate marketing\"]','D','D','D','E','www.fb.com','D','Z','Z','https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/6aEvDr7TqHFsGu8GadlvFtw83YpI6209S36uLiSj.mp4','thumbnail/nowKcdDREmJyBMfIalAFlKOlW9n0IU31rXdASRru.jpg','published','',1,0,1,'2023-05-19 12:44:24','2023-05-21 12:42:25'),(231,199,'maximo','What is alt text, and why is it important?\n\n\'Alt text\' is a contraction of \'alternative text\'. It\'s a short written description of an image, which makes sense of that image when it can\'t be viewed for some reason. \n\nWell-written alt text is important to your website\'s accessibility, and its search engine optimisation (SEO).\n\nAccessibility\n\nIt\'s read by screen readers in place of images, allowing your image content to be accessed by people who are blind or have visual impairment\nIt can be useful to people with certain sensory processing and/or learning disabilities\nIt\'s displayed in place of the image in browsers if the image file hasn\'t loaded, or when the user has chosen not to view images.\nSEO\n\nBecause good alt text provides semantic meaning to, and a description of, an image, it\'s used by search engines to return search results. Thinking about that in another way; good alt text gives search engines more – and better – information to rank your website with; so they\'ll rank it higher. \n\nThe more thoughtfully and helpfully you describe all of your content to users, the easier it is for search engine robots to understand as well.\nDid you know …\n\nIt\'s not just your website where you\'re in control of image alt text. You can also add alt text to the images and animated gifs you upload to Twitter. \n\nFolks using assistive tech like screen readers and braille displays will have access to the written description. And if you’re not using assistive tech, you can still access the alt text by selecting the ‘ALT’ label, which opens the alt text in a modal box.\n\nIt’s a nifty little tool to improve accessibility (and searchability), which still doesn’t seem to be that widely used in the sector. Next time you’re about to tweet a visual – don’t forget the alt text! 🤓','https://drive.google.com/file/d/1ilTYdUMRv3HMcIfJSzW6eIQGpe7hWMVU/view?usp=drivesdk','[\"Human resource management\",\"Email Management\",\"Data Entry\"]',NULL,NULL,NULL,NULL,'www.fb.com',NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/2okFeO2JjWdWhDhFI1cpTfwWK7fkfLzfJh8j32LY.mov','thumbnail/5TuYkZklKGPvnUDfdS9ykcVWwpXPM5aW9p0Avvct.jpg','published','',1,0,1,'2023-05-21 12:48:35','2023-05-21 12:48:35'),(232,201,'Test','Test',NULL,'[\"Quality Assurance\"]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/ebnOpXmIqoOMCpFF4z6ZMc57b45WxLjjnLqqInjb.mov','thumbnail/DB406kEx43Bu04NVFwCcJLjITBCbjPcNDnLICI6R.jpg','published','',0,0,1,'2023-05-21 13:23:25','2023-05-21 13:23:33'),(233,200,'Virtual Assistant','Test 1234567890','https://drive.google.com/drive/u/0/folders/1Bp6KgJtPpPJMxzHfu17vcu15QE_vPNGw','[\"Admin assistant\"]','https://www.upwork.com/freelancers/~0172806b8be9e21ac9','https://www.fiverr.com/phoebe143?up_rollout=true','https://www.linkedin.com/in/phoebe-dawn-mahayag-0a9bba15b/','pibsdon','Phoebe Dawn Mahayag','N/A','Pibsdon08','Pibsdon','https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/hUQ4MjFlTgNZ1d6NDyYDloam9QvkvG1M31KBzpqW.mov','thumbnail/HBhdGHzbU43AmMe4ND2f6Rg22vQ3roWi1vD4Ct6u.jpg','published','',1,0,1,'2023-05-21 13:23:58','2023-05-21 13:23:58'),(234,200,'Admins Assistant','Qwertyuiopasdfghjkl',NULL,'[\"Admin assistant\"]','https://www.upwork.com/freelancers/~0172806b8be9e21ac9','https://www.fiverr.com/phoebe143?up_rollout=tru