nged.\n\n if I select \"1-2 years\" in the search bar, only one profile appears. The other profiles with the same 1-2 years of experience are not showing up.\n\nThe date of birth is not updating correctly. ❌\n\nThe notification bar has some issues where when clicking messages it glitches\n\nReference:\nhttps://drive.google.com/file/d/1Oz7VLMUDZxbDm5Qj22HOmA9VtCywU9MC/view?usp=share_link\n\nhttps://drive.google.com/file/d/1ptoui_itYyX4Z9GcvtDM5CAHlFV9g1Ql/view?usp=sharing\n\n13. I am unable to change my profile picture \n(can\'t.change.profile.pic)\n\n14. When on my profile page, if i click “more info”, the app crashes \n(more.info.app.crash)\n\n15. Brackets and quotation marks are still around the skills when editing my video\n(brackets.around.skills.jpg)\n\n16. I can\'t seem to view the govt. ID photos after I upload them \n(can\'t.view.govt.id.pics.jpg)\n\n17. When trying to update my date of birth - every time I go to edit my profile, my date of birth subtracts one day. It goes from January 17th to 16th to 15th to 14th\n(birth.date.update.glitch)',NULL,'[\"Creative writing\",\"Blogging\",\"Quality Assurance\",\"Logistics Booking\"]',NULL,NULL,NULL,NULL,'www.fb.com',NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/7jjDkpXzdLMGUMPOREjsqVe4StpCzJT1MWj31zEi.mov','thumbnail/tpwSEWBMCpmXp0zbpOX4ZJLOUzqjcshLMv3dSqWK.jpg','published','',1,0,1,'2023-05-21 13:49:47','2023-07-19 05:14:57'),(238,199,'Android','Hi,\nFor Android:\nhttps://expo.dev/artifacts/eas/q6vudrphZvBRwdrzh6RRuB.apk\n\nFor iOS:\nhttps://testflight.apple.com/join/OPMoTgfi\n\nThank You.',NULL,'[\"Proofreading\",\"Tutoring \\/ Teaching\"]',NULL,NULL,NULL,NULL,'www.fb.com',NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/wNVRBtoMyd0yH8hM3hPjmJLnVTzLzyzKOUmlkJ8h.mp4','thumbnail/GLSfcUitjn2cVuyMIyNuNHI1fbj4Py24eTCL9Zys.jpg','published','',1,0,1,'2023-05-21 14:02:06','2023-05-21 14:02:06'),(239,200,'1min video testing','FACTS:\nPetitioner Edna Mabugay-Otamias and retired Francisco Otamias were married on June 16, 1978 and had\nfive children. On September 2000, Edna and Colonel Otamias separated and their children remained with\nEdna. On August 2002, Edna filed a Complaint-Affidavit against Colonel Otamias before the Provost\nMarshal Division of the Armed Forces of the Philippines. Edna Demanded monthly support equivalent to\n75% of Colonel Otamias’ retirement benefit. Colonel Otamias executed an affidavit stating that he can only\nhave 50% of his retirement benefits.\nIn February 2003, Colonel Otamias executed a Deed of Assignment where he waived 50% of his salary and\npension benefits in favor of Edna and their children The Deed of Assignment was considered by the parties\nas a compromise agreement. The agreement was honored until January 2006. Edna alleged that the AFP\nsuddenly decided not to honor the agreement. In a letter dated April 3, 2006, the AFP Pension and Gratuity\nManagement Center (AFP-PGMC) informed Edna that a court order was required for them to recognize the\nDeed of Assignment. In another letter dated April 2006, the AFP-PGMC reiterated that it could not act on\nEdna’s request to receive a portion of Colonel Otamia’s pension “unless ordered by the appropriate court”\nISSUE:\nIs the Deed of Assignment executed by Colonel Otamia valid? Is Colonel Otamias obliged to give support\nby reason of said Deed of Assignment?\nHELD:\nYes, the Deed of Assignment is valid, and consequently, his retirement benefits may be subject to execution,\nfrom which benefits support for Colonel Otamia’s family may be granted.\nThe doctrine of waiver extends to rights and privileges of any character, and, since the word \'waiver\' covers\nevery conceivable right, it is the general rule that a person may waive any matter which affects his property,\nand any alienable right or privilege of which he is the owner or which belongs to him or to which he is legally\nentitled, whether secured by contract, conferred with statute, or guaranteed by constitution, provided such\nrights and privileges rest in the individual, are intended for his sole benefit, do not infringe on the rights of\nothers, and further provided the waiver of the right or privilege is not forbidden by law, and does not\ncontravene public policy; and the principle is recognized that everyone has a right to waive, and agree to\nwaive, the advantage of a law or rule made solely for the benefit and protection of the individual in his private\ncapacity, if it can be dispensed with and relinquished without infringing on any public right, and without\ndetriment to the community at large.\nWhen Colonel Otamias executed the Deed of Assignment, he effectively waived his right to claim that his\nretirement benefits are exempted from execution. His decision to waive a portion of his retirement benefits\ndoes not infringe on the right of third persons, but even protects the right of his family for support. The Deed\nof Assignment executed by Colonel Otamias was not contrary to law; it was in accordance with the\nprovisions on support in the Family Code. Hence, there was no reason for the AFP PGMC not to recognize\nits validity.\nThe provisions of Rule 39 of the Rules of Court that are applicable to this case are in apparent conflict with\neach other. Section 4 provides that judgments in actions for support are immediately executory. On the\nother hand, Section 13(1) provides that the right to receive pension from government is exempt from\nexecution. Based on the Family Code, Colonel Otamias is obliged to give support to his family, petitioners\nin this case. However, he retired in 2003, and his sole source of income is his pension. Judgments in actions\nfor support are immediately executory, yet under Section 31 of Presidential Decree No. 1638, his pension\ncannot be executed upon.',NULL,'[\"Human resource management\"]','https://www.upwork.com/freelancers/~0172806b8be9e21ac9','https://www.fiverr.com/phoebe143?up_rollout=true','https://www.linkedi