Y 2:\n\nPhoebe couldn’t successfully add new social media links to her profile \nhttps://drive.google.com/drive/folders/1sJHk6i66acXps-9Nt5MN_mKCSqUEEvks\n\nWhen trying to choose a password, Emily received an error message saying that she needed to include one special character, but it didn’t recognize all special characters. She couldn’t use a period or an apostrophe at all, even if she included other special characters \nhttps://drive.google.com/file/d/1LMO3JAc1QqSPZbqNXPrVvrgkRspT6zwX/view?usp=drive_link \n\nWhen Phoebe exits the app and opens it again, she sometimes can’t see the videos on the newsfeed until she refreshes the app a couple of times (she just sees a black screen)\nhttps://drive.google.com/drive/folders/1sJHk6i66acXps-9Nt5MN_mKCSqUEEvks\n\nThere’s a delay when pressing the capture button to upload a photo during signup \n\nOdry says she can’t click on the FB link on the “more information” button under some VCLs (the other links worked) \n\nWhen Sam locks his screen while on the app, the audio still plays in the background \n\nSam said all users had the same last initial (T) (Because every user have name with last initial T)\nhttps://drive.google.com/drive/folders/1sJHk6i66acXps-9Nt5MN_mKCSqUEEvks\n\nOnce Sam gets to the subscription page and backs out of it to go to his profile page, the app will take him back to the subscription page instead and he can’t get back to his profile without closing the app\n\nPhoebe said the State is wrong in the app profile.\nhttps://drive.google.com/drive/folders/1sJHk6i66acXps-9Nt5MN_mKCSqUEEvks\n\nPhoebe says the bio field only allowed 191 characters, but it says the limit is 300 characters\n\nOdry says there was a time when the app said she was subscribed, but the subscription didn’t list any price\nhttps://drive.google.com/file/d/1_GR5rsx0pq2xbBHQ7rQJtgJHo8aS9cOm/view?usp=drivesdk\n\nVideo is stretched while recording for Android users, but looks normal when watching it back\nhttps://drive.google.com/file/d/1GHDJxRa5Lr05Ee6l4TST8pTKWlwGkf42/view?usp=sharing\n\nIn the skills drop-down box, there are about 10 skills abbreviated with three dots, making them confusing as to what they are \n\n\n\nPRIORITY 3:\n\nSkills should have the first letter of all words capitalized or just the first letter in the first word, but it needs to be consistent either way \nhttps://drive.google.com/file/d/1AWlfHjaVWEUrL8q6M6bwe51pLylGJdIz/view?usp=drive_link \n\n\nWhen trying to upload a photo, the text at the bottom of the screen that says “Tap for photo” is kind of cut off \nhttps://drive.google.com/file/d/1XENvrlBGKkQFRK_cji2OueEMeoEM6ulf/view?usp=drive_link\n\nWhen using a camera to take a profile photo, there\'s a 3–4 second delay before it captures the photo.',NULL,'[\"Admin assistant\",\"Animation\",\"Appointment setter\",\"Architecture\"]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/ALAkeCDEXe55B3OPWtgbJingTexvEY1ajNdAKzrW.mp4','thumbnail/EnPNb07gl87JiNpVSgUEn0iZuhZbWeaHTb753mZa.jpg','published','',0,0,1,'2023-07-24 11:01:29','2023-08-23 20:22:14'),(261,214,'Smiley Avocado','Squeaky Avocado',NULL,'[\"Blogging\"]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/Apfg0kHXVovRk9FlZS9gX0JjiXLBLlkrIQ3mCOdE.mp4','thumbnail/BapxqnP1D9SncwLiAnFmSSEgA2qVnZSazi3nTVRj.jpg','under-review','',1,0,1,'2023-07-24 11:47:24','2023-07-24 11:47:24'),(262,214,'Squeaky Avocado','Squeaky Avocado',NULL,'[\"Blogging\"]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/6TRefuyycedvIxIFfCqBJzPz15dL1I38ybQapBem.mp4','thumbnail/OVfMS7cUYblJEZBkuEd14wfOu7YUFjmy5LZVbrzF.jpg','published','',1,0,1,'2023-07-24 11:48:35','2023-07-24 11:48:35'),(263,199,'Test','ha ha\n/ˈhä ˌhä/\nexclamation\nexclamation: haha\nused to represent laughter or amusement.\n\"“Oh ha ha, very funny,“ I said\"\nOrigin\nnatural utterance: first recorded in Old English (compare with ha1).\nha-ha\n/ˈhäˌhä/\n