ually engage even though they are blue links. \nLink:\n https://drive.google.com/file/d/1A_T3fhVFKu3uYhvvnZhoNlCX1tqXTMff/view?usp=sharing \n\nTwitter is now named “X”, so we need to change that in the app\n\nI am still experiencing a very slow loading of the first opening video\n\nI still never encounter a prompt to read or even look at the privacy policy or terms and conditions. That needs to pop up during the sign-up process and be accepted to use the app, and it needs to be required, not optional.',NULL,'[\"3d modeling\",\"Admin assistant\",\"Cisco networking\",\"Animation\",\"Appointment setter\",\"Blogging\"]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/2bQZKIrhDTAQHe6GMRCgnLSwgOrLaGUrINtgLic4.mp4','thumbnail/zJwmDKIwH1LAxDS2OpjTJ8QgEvgfKuOdn6IpjHBt.jpg','published','',1,0,1,'2023-08-28 08:42:33','2023-08-28 08:42:33'),(274,199,'Mushroom Lamp','Description sample here testing enter keypad icon',NULL,'[\"Back-end development\"]',NULL,NULL,NULL,'hello',NULL,'hi',NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/4bvHHsNaAFUhN8ntvLtCBA9c7TLejSqWAbv2DSCu.mp4','thumbnail/WU7FybOGZGtIS8E9YkxLNspWT8B2Dvdm810jok6C.jpg','published','',1,0,1,'2023-08-28 09:27:46','2023-08-28 09:27:46'),(275,217,'Testing Jobreels App','For Testing',NULL,'[\"3d modeling\",\"Admin assistant\",\"Animation\",\"Appointment setter\",\"Architecture\",\"Back-end development\"]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://jobreels.s3.us-east-2.amazonaws.com/PostVideos/daan3M92IJxElGm7VK4eEwVQCON3qJiKQJOMsQOS.mp4','thumbnail/SN4WCWLxNTx9R508rBNAq7ybD1bZdSZs5vawe8ao.jpg','published','',1,0,1,'2023-08-28 09:53:39','2023-08-28 09:55:19');
